import {useState} from "react";

function Footer() {
    const [isLoggedIn, setIsLoggedIn] = useState(false)
    return (
        <>
            {isLoggedIn ? (
                <p>Footer Logged In</p>
            ) : (
                <p>Footer Logged Out</p>
            )}
        </>
    );
}

export default Footer;
